import React, { Component } from 'react';
import ChartJs from '../../components/ChartJs';
import MoldePesquisa from '../../components/molde-barra-pesquisa';
import MoldeSide from '../../components/molde-sidebar/molde-sidebar';
import './style.css';


export default class Dashboard extends Component {
    render() {
        return (
            <div>
                {/* <MoldeSide />
                <MoldePesquisa /> */}

                <div className="conteudo">


                    <div className="container">

                        <section className="conteudo__dash caixa">

                            <input type="submit" value="Visão geral" className="botao1 botao" />

                            <input type="submit" value="Café da manhã" className="botao2 botao" />

                            <input type="submit" value="Almoço" className="botao3 botao" />

                            <input type="submit" value="Janta" className="botao4-botao" />

                            <input type="submit" value="Gerar relatório" className="botao5-botao" />


                            <div className="dashboard">
                                <ChartJs />

                            </div>


                        </section>




                    </div>






                </div>

            </div>
        )
    }
}
